import React from "react";


const Contact = (props) => {

    const [contacts, setContacts] = React.useState([]);

    React.useEffect(() => {
        const getContacts = async () => {
            const response = await fetch("/contacts");
            const data = await response.json();

            console.log(data);

            setContacts(data);
        }

        getContacts();
    }, []);

    return (
        <section id="contact">
            {
                contacts.map(contact => {
                    return (
                        <div>
                            <h3>{contact.dept}</h3>
                            <h4>{contact.name}</h4>
                            <h4>{contact.email}</h4>
                        </div>
                    );
                })
            }
        </section>
    );
};


export default Contact;
